import React from 'react';
import { Box, Button, Heading, Grommet } from 'grommet';
import { Home, Book } from 'grommet-icons';

const theme = {
  global: {
    colors: {
      brand: '#116466',
    },
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function App() {

  function AppBar() {
    return (
      <Box
        tag='header'
        direction='row'
        align='center'
        justify='center'
        background='brand'
        pad={{ left: 'medium', right: 'small', vertical: 'small' }}
        elevation='medium'
        style={{ zIndex: '1' }}
      >
        <Heading level={3}>Fuad Sahmawi</Heading>
        <Button icon={<Home />} onClick={() => {}} />
        <Button icon={<Book />} onClick={() => {}} />
      </Box>
    );
  };

  return (
    <Grommet theme={theme}>
    <AppBar/>
    </Grommet>
  );
}

export default App;
